      longitude: 0.0,
      population: "",
     };
    this.onSort = this.onSort.bind(this)
  }

  componentDidMount() {
    const request_headers = {
      headers: {
        "PRIVATE-TOKEN": "AGN7CEcDXss1xRubmb2F"
      }
    };

    setTimeout(() => {
      fetch("/api/City/")
          .then(response => response.json())
          .then(data => {
              setTimeout(() => {
                  this.setState({name: data.name });
              }, 200);
          });
    }, 500);


